import { ToastContainer } from 'react-toastify'


export default function Toast() {
  return (
    <div>
<ToastContainer           
            position="top-center"
            autoClose={500}
            hideProgressBar={false}
            newestOnTop={false}
            closeOnClick
            rtl={false}
            pauseOnFocusLoss
            draggable
            pauseOnHover
            theme="dark"           
        />         
        </div>
  )
}
